import React, { useState } from 'react'

function Hello() {

    const [he, setHe] = useState(true)
    const [she, setShe] = useState(true)

    return (
        <div>
            <button style={{ display: he ? 'none' : 'flex' }}>he</button>
            <button onClick={() => setHe(!he)}>she</button>
        </div>
    )
}

export default Hello
